def write_data(link_matrix, label_list, value_list):
    value_list = list(map(lambda x: x * len(value_list), value_list))
    gexf = Gexf("data.gexf", "A Web network")
    graph = gexf.addGraph("directed", "static", "A Web network")
    importance = graph.addNodeAttribute('importance', force_id='importance', type='float')
    category = graph.addNodeAttribute('category', force_id='category')
    gap_value = (max(value_list)*1.00001) / 6
    for t, i in enumerate(label_list):
        if int(value_list[t] / gap_value)>4:
            print(int(value_list[t] / gap_value))
        node = graph.addNode(t, i)
        node.addAttribute(importance, str(value_list[t]))
        node.addAttribute(category, str(int(value_list[t] / gap_value)))

    count = 0
    for row, i in enumerate(link_matrix):
        for col, j in enumerate(i):
            if j != 0:
                graph.addEdge(count, str(row), str(col))
                count += 1

    path = os.getcwd()
    output_file = open(path+"/data.gexf", "wb")
    # todo 这里的路径要与服务器指定的路径一致
    gexf.write(output_file)
